INSERT INTO `generations` (`ID`, `generation_name`, `generation_origin`, `description`, `age_start`, `age_end`, `generations_model_id`) VALUES
(1001, 'Lost', 'Historical', '(Nomad, born 1883?1900) This generation grew up amidst urban blight, unregulated drug use, child ?sweat shops,? and massive immigration. Their independent, streetwise attitude lent them a ?bad kid? reputation. After coming of age as ?flaming youth,? doughboys, and flappers, they were alienated by a war whose homecoming turned sour. Their young-adult novelists, barnstormers, gangsters, sports stars, and film celebrities gave the roar to the ?20s. The Great Depression hit them in midlife, at the peak of their careers. The ?buck stopped? with their pugnacious battlefield and homefront managers of a hot war?and Generations in History 5 of 6\r\ntheir frugal and straight-talking leaders of a new ?cold? one. As elders, they paid high tax rates to support their world-conquering juniors, while asking little for themselves. (AMERICAN: Harry Truman, Irving Berlin, George Patton, Mae West, F. Scott Fitzgerald, Louis Armstrong; Foreign: Adolph Hitler, Mao Zedong)', 1883, 1900, 1000),
(1002, 'GI', 'Historical', '(Hero, born 1901?1924) This generation developed a special and ?good kid? reputation as the beneficiaries of new playgrounds, scouting clubs, vitamins, and child-labor restrictions. They came of age with the sharpest rise in schooling ever recorded. As young adults, their uniformed corps patiently endured depression and heroically conquered foreign enemies. In a midlife subsidized by the G.I. Bill, they built gleaming suburbs, invented miracle vaccines, plugged ?missile gaps,? and launched moon rockets. Their unprecedented grip on the Presidency began with a New Frontier, a Great Society, and Model Cities, but wore down through Vietnam, Watergate, deficits, and problems with ?the vision thing.? As ?senior citizens,? they safeguarded their own ?entitlements? but had little influence over culture and values. (AMERICAN: John Kennedy, Ronald Reagan, Walt Disney, Judy Garland, John Wayne, Walter Cronkite; Foreign: Willy Brandt, Leonid Brezhnev)', 1901, 1924, 1000),
(1003, 'Silent', 'Historical', '(Artist, born 1925?1942) This generation grew up as the suffocated children of war and depression. They came of age just too late to be war heroes and just too early to be youthful free spirits. Instead, this early-marrying Lonely Crowd became the risk-averse technicians and professionals as well as the sensitive rock ?n rollers and civil-rights advocates of a post-crisis era in which conformity seemed to be a sure ticket to success. Midlife was an anxious ?passage? for a generation torn between stolid elders and passionate juniors. Their surge to power coincided with fragmenting families, cultural diversity, institutional complexity, and prolific litigation. They are entering elderhood with unprecedented affluence, a ?hip? style, and a reputation for indecision. (AMERICAN: Colin Powell, Walter Mondale, Woody Allen, Martin Luther King, Jr., Sandra Day O?Connor, Elvis Presley; Foreign: Anne Frank, Mikhail Gorbachev)', 1925, 1942, 1000),
(1004, 'Boom', 'Historical', '(Prophet, born 1943?1960) This generation basked as children in Dr. Spock permissiveness, suburban conformism, Sputnik-era schooling, Beaver Cleaver friendliness liness, and Father Knows Best family order. From the Summer of Love to the Days of Rage, they came of age rebelling against the worldly blueprints of their parents. As their ?flower child,? Black Panther, Weathermen, and Jesus Freak fringes proclaimed themselves arbiters of public morals, youth pathologies worsened?and SAT scores began a 17-year slide. In the early 1980s, many young adults became self-absorbed ?yuppies? with mainstream careers but perfectionist lifestyles. Entering midlife (and national power), they are trumpeting values, touting a ?politics of meaning,? and waging scorched-earth Culture Wars. (AMERICAN: Bill Clinton, Newt Gingrich, Steven Spielberg, Candice Bergen, Spike Lee, Bill Gates; Foreign: Tony Blair, Binyamin Netanyahu)', 1943, 1960, 1000),
(1005, 'Generation X', 'Historical', 'The 13th Generation (Nomad, born 1961–1981) survived a \"hurried\" childhood of divorce, latchkeys, open classrooms, devil-child movies, and a shift from G to R ratings. They came of age curtailing the earlier rise in youth crime and fall in test scores—yet heard themselves denounced as so wild and stupid as to put The Nation At Risk. As young adults, maneuvering through a sexual battlescape of AIDS and blighted courtship rituals—they date and marry cautiously. In jobs, they embrace risk and prefer free agency over loyal corporatism. From grunge to hip-hop, their splintery culture reveals a hardened edge. Politically, they lean toward pragmatism and nonaffiliation, and would rather volunteer than vote. Widely criticized as \"Xers\" or \"slackers,\" they inhabit a Reality Bites economy of declining young-adult living standards. (AMERICAN: Tom Cruise, Jodie Foster, Michael Dell, Deion Sanders, Winona Ryder, Quentin Tarantino; FOREIGN: Princess Di, Alanis Morissette)', 1961, 1981, 1000),
(1006, 'Millennial', 'Historical', '(Nomad, born 1961?1981) This generation survived a ?hurried? childhood of divorce, latchkeys, open classrooms, devil-child movies, and a shift from G to R ratings. They came of age curtailing the earlier rise in youth crime and fall in test scores?yet heard themselves denounced as so wild and stupid as to put The Nation At Risk. As young adults, maneuvering through a sexual battlescape of AIDS and blighted courtship rituals?they date and marry cautiously. In jobs, they embrace risk and prefer free agency over loyal corporatism. From grunge to hip-hop, their splintery culture reveals a hardened edge. Politically, they lean toward pragmatism and nonaffiliation, and would rather volunteer than vote. Widely criticized as ?Xers? or ?slackers,? they inhabit a Reality Bites economy of declining young-adult living standards. (AMERICAN: Tom Cruise, Jodie Foster, Michael Dell, Deion Sanders, Winona Ryder, Quentin Tarantino; Foreign: Princess Di, Alanis Morissette)', 1982, 2002, 1000);
